import React from 'react';
import logo from './logo.svg';
import './App.css';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Toast from 'react-bootstrap/Toast';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import { Button, NavDropdown, Nav, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import Board from './board.js'

function foo(){
  document.getElementById("home").style.display ="none"
  document.getElementById("link").style.display="block"
}
function App() {
  return (
    <Container>
      <Navbar>
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link" onClick="foo()">Projects</Nav.Link>
              <Nav.Link href="#link">Notes</Nav.Link>
              <NavDropdown title="Teaching" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Spring 2020</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Fall 2019</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">Summer 2019</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">CSM Spring 2020</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.4">CSM Fall 2019</NavDropdown.Item>
              </NavDropdown>
            </Nav> 
          </Navbar.Collapse>
    </Navbar>
    <Jumbotron id="home">

    </Jumbotron>
    <div id="link" style={{display:"none"}}>
        <Card bg='light' border='dark'>
             <Card.Header>Chess Game</Card.Header>

            <Card.Body>
              This is some text within a card body.
              <Board/>
            </Card.Body>
        </Card>
        </div>
    </Container>


  );
}

export default App;
